angular.module("imageService",[]).factory("Image",["$http","Upload",function($http,Upload){var image={};return image.all=function(){return $http.get("api/images")},image.latest=function(){return $http.get("api/images/latest")},image.get=function(id){return $http.get("api/images/"+id)},image.getCrop=function(id){return $http.get("api/images/cropped/"+id)},image.add=function(file){return Upload.upload({url:"api/images/add",file:file,test:"spoons"})},image.update=function(id,data){return $http.put("api/images/"+id,data)},image["delete"]=function(id){return $http["delete"]("api/images/"+id)},image.crop=function(data){return $http.put("api/images/crop",data)},image}]);